-- Volcando estructura para función prueba.FN_CHECK_LOW
DROP FUNCTION IF EXISTS `FN_CHECK_LOW`;
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `FN_CHECK_LOW`(`PT_FK_STUDENT` BIGINT, `PT_FK_PERIOD` BIGINT) RETURNS int(11)
BEGIN
	DECLARE VAR_AVG DOUBLE;
	SET VAR_AVG = (
		SELECT
			AVG(FL_FINAL_CALIFICATION)
		FROM
			tb_califications_of_students_by_matters
		WHERE TRUE
			AND tb_califications_of_students_by_matters.FK_STUDENT=PT_FK_STUDENT
			AND tb_califications_of_students_by_matters.FK_PERIOD=PT_FK_PERIOD
	);
	IF(VAR_AVG<8)THEN
		UPDATE
			db_siut_dev.tb_students
			SET db_siut_dev.tb_students.FL_DOWN=1
		WHERE TRUE
			AND db_siut_dev.tb_students.PK_STUDENT=PT_FK_STUDENT;
	END IF;
	RETURN 1;
END//
DELIMITER ;


-- Volcando estructura para función prueba.FN_CREATE_CODE
DROP FUNCTION IF EXISTS `FN_CREATE_CODE`;
DELIMITER //
CREATE DEFINER=`root`@`%` FUNCTION `FN_CREATE_CODE`() RETURNS longtext CHARSET utf8 COLLATE utf8_spanish_ci
BEGIN
	SET group_concat_max_len = 1000000000;
	SET @sql = NULL;
	SET @create_view = NULL;
	SELECT
		GROUP_CONCAT('
			SELECT
				(SELECT PK_CARRER FROM tb_pal101_sep_dic2015 WHERE PK_ROW=2) AS PK_CAREER,
				(SELECT PK_STUDY_PLANN FROM tb_pal101_sep_dic2015 WHERE PK_ROW=2) AS PK_STUDY_PLANN,
				(SELECT PK_SEMESTER FROM tb_pal101_sep_dic2015 WHERE PK_ROW=2) AS PK_SEMESTER,
				(SELECT PK_PERIOD FROM tb_pal101_sep_dic2015 WHERE PK_ROW=2) AS PK_PERIOD,
				FL_ENROLLMENT,
				FN_GET_PK_STUDENT(FL_ENROLLMENT) AS PK_STUDENT,
				(SELECT ',COLUMN_NAME,' FROM tb_pal101_sep_dic2015 WHERE PK_ROW=1) AS FK_SUBJECT,
				PK_ROW,
				(				
					SELECT
						 SUM(',COLUMN_NAME,')
					FROM
						tb_pal101_sep_dic2015 AS TB_TEMP
					WHERE TRUE
						AND TB_TEMP.PK_ROW=tb_pal101_sep_dic2015.PK_ROW
				) AS FL_FINAL_CALIFICATION
			FROM
				tb_pal101_sep_dic2015
			WHERE TRUE
				AND PK_ROW!=1
				AND !ISNULL(',COLUMN_NAME,')
		' SEPARATOR ' UNION ') INTO @sql
	FROM
		information_schema.COLUMNS
	WHERE TRUE
		AND COLUMN_NAME!="PK_ROW"
		AND COLUMN_NAME!="PK_STUDY_PLANN"
		AND COLUMN_NAME!="PK_SEMESTER"
		AND COLUMN_NAME!="PK_CARRER"
		AND COLUMN_NAME!="FL_ENROLLMENT"
		AND COLUMN_NAME!="PK_PERIOD"
		AND TABLE_SCHEMA="prueba"
		AND TABLE_NAME="tb_pal101_sep_dic2015";
	RETURN @sql;
END//
DELIMITER ;


